import logo from './logo.svg';
import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Accueil from './pages/Accueil';

function App() {
  return (
    <Router>
      <Switch>
      <Route exact path="/" component={Accueil} />
      </Switch>
    </Router>
  );
}

export default App;
